import React, {
  useEffect,
  useState,
  useContext,
  useRef,
  Suspense
} from "react";
import * as THREE from "three";
import { OrbitControls, Stars, Text, Html } from "@react-three/drei";
import SkillsCube from "./SkillsCube";
import Typography from "@material-ui/core/Typography";
const Skills = (props) => {
  //contains the skill and image associated with that skill for the skills grid
  const [SkillsImages, SetSkillsImages] = useState([
    [
      "React",
      "https://upload.wikimedia.org/wikipedia/commons/thumb/a/a7/React-icon.svg/1200px-React-icon.svg.png"
    ],
    [
      "HTML",
      "data:image/png;base64,"
    ],
    [
      "CSS",
      "data:image/png;base64,"
    ],
    [
      "SASS",
      "data:image/png;base64,"
    ],
    [
      "Jython",
      "https://www.saashub.com/images/app/service_logos/85/813f0e075da8/large.png?1569940863"
    ],
    [
      "C#",
      "data:image/png;base64,"
    ],
    [
      "SQL",
      "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRlhU2quuB_rBfOTLXwexp9domNXQx05QYk5A&usqp=CAU"
    ],
    [
      "Power Shell",
      "https://3.bp.blogspot.com/-a7jPVdFk9Hw/W_XeTJX6JyI/AAAAAAAAC2c/HCtxP0wSSs0wEMKJOYq7pivEJaSVin92gCLcBGAs/s1600/powershell.png"
    ],

    [
      "Azure",
      "data:image/png;base64,"
    ],
    [
      "Github",
      "data:image/png;base64,"
    ],
    [
      "NPM",
      "https://cdn.iconscout.com/icon/free/png-512/npm-2336953-1982834.png"
    ],

    [
      "GIT",
      "data:image/jpeg;base64,"
    ]
  ]);
  //takes the images and puts them on the skin of the square
  useEffect(() => {
    var SkillsImages2 = [];
    SkillsImages.forEach((url, index) => {
      //generates texture based on url
      var ImageTexture = new THREE.TextureLoader().load(url[1]);
      SkillsImages2.push([url[0], ImageTexture]);
    });

    SetSkillsImages(SkillsImages2);
  }, []);
  console.log(SkillsImages);
  //loops through all the skills and renders the cube in a 3D space
  const RenderSkills = () => {
    var Skills = [];
    var Group = [];
    var SpaceCounter = 0;
    {
      SkillsImages.map((texture, index) => {
        SpaceCounter += 2;
        switch (index) {
          //renders first row
          case 0:
            Skills.push(
              <group position={[0, 3, props.SkillsPosition]}>{Group}</group>
            );
            Group = [];
            Group.push(
              <Html
                position={[0, 1.5, props.SkillsPosition - 1.5]}
                distanceFactor={10}
              >
                <div class="SkillsTitle">
                  <Typography display="inline" variant="h4">
                    {" "}
                    Front End:{" "}
                  </Typography>
                </div>
              </Html>
            );
            break;
          //renders 2nd row
          case 4:
            Skills.push(
              <group position={[0, 1.5, props.SkillsPosition]}>{Group}</group>
            );
            Group = [];
            Group.push(
              <Html
                position={[0, 1.5, props.SkillsPosition - 1.5]}
                distanceFactor={10}
              >
                <div class="SkillsTitle">
                  <Typography display="inline" variant="h4">
                    {" "}
                    Back End:{" "}
                  </Typography>
                </div>
              </Html>
            );
            break;
          //renders third row
          case 8:
            Skills.push(
              <group position={[0, -1, props.SkillsPosition]}>{Group}</group>
            );
            Group = [];
            Group.push(
              <Html
                position={[0, 1.5, props.SkillsPosition - 1.5]}
                distanceFactor={10}
              >
                <div class="SkillsTitle">
                  <Typography display="inline" variant="h4">
                    {" "}
                    MISC:{" "}
                  </Typography>
                </div>
              </Html>
            );
            break;
        }

        Group.push(
          <SkillsCube
            SkillsPosition={props.SkillsPosition}
            index={index}
            texture={texture}
            SpaceCounter={SpaceCounter}
          />
        );
        //renders last row
        if (index == 11) {
          Skills.push(
            <group position={[0, -3.5, props.SkillsPosition]}>{Group}</group>
          );
          Group = [];
        }

        if (SpaceCounter == 8) {
          SpaceCounter = 0;
        }
      });
    }

    return Skills;
  };
  return (
    <>
      {/*renders the title of the skills section */}
      <group position={[0, 0, props.SkillsPosition - 4]}>
        <Html position={[0, 4.5, -2.5]} distanceFactor={10}>
          <div class="SkillsTitle">
            <Typography display="inline" variant="h2">
              {" "}
              My Skills
            </Typography>
          </div>
        </Html>

        {RenderSkills()}
      </group>
    </>
  );
};

export default Skills;
